import Header from "../componets/header";
import Footer from "../componets/footer";
function Demo() {
  return (
    <div>
      <Header/>
      
      <h1>hello</h1>
      
    </div>
  );
}
function Demo1(){
  return (
    <div>
      <h2>hai</h2>
      <Footer/>
    </div>

  );
}
export {Demo,Demo1};
